window.bookSummaryJSON = "<p><b>Welcome to Somerset.</b></p> <p>A land of mystery and magic! You have been chosen by our Illustrious Overlord to take part in the Rules: a no-holds-barred death match to see who among you is the most powerful. You have been transported here against your will. The only way back is to reach level 100 and defeat the final boss. Please do be careful with your life, as it is the only one you’ll get. Have a pleasant match, and remember, we’re always watching....</p> <p>When Sam wakes up in a strange new world with a message floating before his eyes, he thinks he's hallucinating. However, he soon discovers a land filled with dungeons, monsters, angry gnomes, and even worse, talking dogs!</p> <p>Warning: Contains profanity and content that may not be suitable for children. This is a LitRPG book, containing multiple stat sheets, message windows, dungeons, and epic loot.</p>"; 
